import Login from "./Login"
import Register from "./Register";


function App() {

const [user,setUser]= useState(null);

  return (
  <>
    <Header />
    {!user && <Login  setUser={setUser}/>}
    {user && <h1>Hi {user.first_name} !</h1>}
    <Footer />
  </> );
}

export default App;
